import React from "react";

const Text1 = ({ onClick, value, className }) => {
  return (
    <span
      className={`inline-flex items-center rounded-full border border-transparent bg-indigo-600 p-2 text-white shadow-sm hover:bg-indigo-800 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2 ${className}`}
      onClick={onClick}
    ></span>
  );
};

export default Text1;
